import { Component, OnInit } from '@angular/core';
import { CommonModule } from '@angular/common';
import { MatTableModule } from '@angular/material/table';
import { MatPaginatorModule } from '@angular/material/paginator';
import { MatSortModule } from '@angular/material/sort';
import { Candidate } from '../../models/candidate.model';
import { CandidateService } from '../../services/candidate.service';

@Component({
  selector: 'app-candidate-table',
  standalone: true,
  imports: [CommonModule, MatTableModule, MatPaginatorModule, MatSortModule],
  template: `
    <div class="table-container">
      <table mat-table [dataSource]="candidates" class="mat-elevation-z8">
        <!-- Nombre Column -->
        <ng-container matColumnDef="name">
          <th mat-header-cell *matHeaderCellDef>Nombre</th>
          <td mat-cell *matCellDef="let candidate">{{ candidate.name }}</td>
        </ng-container>

        <!-- Apellido Column -->
        <ng-container matColumnDef="surname">
          <th mat-header-cell *matHeaderCellDef>Apellido</th>
          <td mat-cell *matCellDef="let candidate">{{ candidate.surname }}</td>
        </ng-container>

        <!-- Seniority Column -->
        <ng-container matColumnDef="seniority">
          <th mat-header-cell *matHeaderCellDef>Seniority</th>
          <td mat-cell *matCellDef="let candidate">
            {{ candidate.seniority }}
          </td>
        </ng-container>

        <!-- Years of Experience Column -->
        <ng-container matColumnDef="yearsOfExperience">
          <th mat-header-cell *matHeaderCellDef>Años de Experiencia</th>
          <td mat-cell *matCellDef="let candidate">
            {{ candidate.yearsOfExperience }}
          </td>
        </ng-container>

        <!-- Availability Column -->
        <ng-container matColumnDef="availability">
          <th mat-header-cell *matHeaderCellDef>Disponibilidad</th>
          <td mat-cell *matCellDef="let candidate">
            <span
              class="availability-indicator"
              [class.available]="candidate.availability"
            >
              {{ candidate.availability ? 'Disponible' : 'No disponible' }}
            </span>
          </td>
        </ng-container>

        <tr mat-header-row *matHeaderRowDef="displayedColumns"></tr>
        <tr mat-row *matRowDef="let row; columns: displayedColumns"></tr>
      </table>

      <div *ngIf="candidates.length === 0" class="no-data">
        No hay candidatos registrados aún.
      </div>
    </div>
  `,
  styles: [
    `
      .table-container {
        margin: 20px auto;
        max-width: 1000px;
      }
      table {
        width: 100%;
      }
      .availability-indicator {
        padding: 3px 8px;
        border-radius: 4px;
        font-size: 12px;
      }
      .availability-indicator.available {
        background-color: #c8e6c9;
        color: #2e7d32;
      }
      .availability-indicator:not(.available) {
        background-color: #ffcdd2;
        color: #c62828;
      }
      .no-data {
        text-align: center;
        padding: 20px;
        font-style: italic;
        color: #757575;
      }
    `,
  ],
})
export class CandidateTableComponent implements OnInit {
  candidates: Candidate[] = [];
  displayedColumns: string[] = [
    'name',
    'surname',
    'seniority',
    'yearsOfExperience',
    'availability',
  ];

  constructor(private candidateService: CandidateService) {}

  ngOnInit(): void {
    this.candidateService.getCandidates().subscribe((candidates) => {
      this.candidates = candidates;
    });
  }
}
